import "./App.css";
const NavBar = () => {
    return(
    <div className="navBar">
        <a className="navButton" href="https://nphs.npenn.org/" target="_blank" rel="noreferrer">HOME</a>
        <a className="navButton" href="https://nphs.npenn.org/" target="_blank" rel="noreferrer">ANNOUNCEMENTS</a>
        <a className="navButton" href="https://nphs.npenn.org/" target="_blank" rel="noreferrer">EVENTS</a>
        <a className="navButton" href="https://nphs.npenn.org/" target="_blank" rel="noreferrer">BLOG</a>
    </div>
    )
}

export default NavBar;
